import React from 'react'
import '../components/passage.css'

const Passage=()=>{
    return(
        <p>The i10 has a large gaping air dam, pulled-back headlamps, chrome lined grille, 
        integrated clear lens fog lamps, a hood that has a clam shell hint and a rear 
        window with an up swept kink.The tailgate has a chrome lined boot release handle,
        and an integrated roof spoiler on the top end versions.</p>
    );

}
export default Passage
